import React, {Component} from 'react';
import './style.css';

const header_background = {
    backgroundColor:'#77d0f2',
};

class Navbar extends Component {

    render() {
        return (
            <div className="nav_body">
                <div className="pad20 nav_header" style={header_background}>
                    <h1 className="font_white">撸猫记录</h1>
                </div>

                <div class="square_panel">
                    <span class="day_count">1</span>
                    <button type="button" class="btn btn-primary">打卡</button>
                </div>
            </div>

        );
    }

}

export default Navbar;
